import { Route, Routes } from "react-router";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/home" element={<h1>Home</h1>}></Route>
        <Route path="/welcome" element={<h1>welcome</h1>}></Route>
        <Route path="/product" element={<h1>Product</h1>}></Route>
        <Route path="/" element={<Redirect></Redirect>}></Route>
      </Routes>
    </div>
  );
}

export default App;
